import React from "react";
import { Link } from "react-router-dom";
import { FaServicestack } from "react-icons/fa";
import { Route,Routes } from "react-router-dom";
import LOGIN from "./Login";
import USERHOME from "./UserHome";
import REGISTER from "./Register";

const Navigator = () => {
  return (
    <div>
      <nav
        className="navbar navbar-expand-lg navbar-light"
        style={{ backgroundColor: "orange" }}
      >

        <Link to="/home" style={{ textDecoration: "none",color:'black',fontSize:'50px'}}>Online Shopping</Link>
        <button
          className="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        {
          //this is login button*****************************************************************************************
        }
        <div className="collapse navbar-collapse  justify-content-end">
          <ul className="navbar-nav">
            <li className="nav-item active mr-3">
              <a className="nav-link" href="#!">
                <FaServicestack style={{ fontSize: "30px" }} />5
              </a>
            </li>

            <li className="nav-item active ml-6">
              <Link to="/login" style={{fontSize:'30px',textDecoration: "none",color:'black'}}>Login</Link>

            </li>
            <li className="nav-item active">
            <Link to="/login" style={{fontSize:'30px',textDecoration: "none",color:'black'}}>Register</Link>

            </li>
          </ul>
        </div>
      </nav>
      <Routes>
          <Route path="/login" element={<LOGIN />} />
          <Route path="/home" element={<USERHOME/>}/>
          <Route path="/register" element={<REGISTER />}/>
        </Routes>
    </div>
  );
};
export default Navigator;
